import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="navbar">
      <div className="brand-logo">Hello</div>
      <div className="list">
        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">About</a></li>
          <li><a href="#">Project</a></li>
          <li><a href="#">About</a></li>
        </ul>
      </div>
    </div>
      </header>
    </div>
  );
}

function Navbar() {

  return(
    <div className="navbar">
    <div className="brand-logo">Hello</div>
    <div className="list">
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Project</a></li>
        <li><a href="#">About</a></li>
      </ul>
    </div>
  </div>
  )
}

export default App;
